import SideNavBar from "../Components/SideNavBar";
import Box from "@mui/material/Box";
import NavBar from "../Components/NavBar";

import { useNavigate } from "react-router-dom";


import { Avatar, Stack } from "@mui/material";
import i12  from '../image/i12.PNG'
import i10 from '../image/i10.PNG'
import i11  from '../image/i11.PNG'

function Publisher() {
  
  const navigate = useNavigate();
  const handleClick = () => {
    navigate("/") 
  }

  return (
    <>
    <NavBar />
    <Box>
      <Box height={30}/>
      <Box sx={{ display: "flex" }}>
        <SideNavBar />

        <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
          <h1>Publisher</h1>
          <Stack spacing={10} direction="row">
          
            < Avatar src={i12} alt="Pic not found" sx={{bgcolor:"secondary.main", width:80, height:190}} onClick = {handleClick}/>
           <Avatar src={i10} alt="Pic not found" sx={{bgcolor:"secondary.main", width:80, height:190}} onClick = {handleClick}/>
           <Avatar src={i11} alt="Pic not found" sx={{bgcolor:"secondary.main", width:80, height:190}} onClick = {handleClick}/>
          </Stack>
          </Box>
        </Box>
      </Box>
    </>
  );
}
export default Publisher;
